        className="mdiart"
        src="https://anima-uploads.s3.amazonaws.com/projects/6492c55c74995fc792d0df14/releases/6493fbc959e3e5a943ada352/img/mdi-art.svg"
        alt="mdi:art"
      />
      <div>
       <h1>Art</h1> 
      </div>
    <button> home</button>

    </div>
    
  );
}

export default Art;
